(function (cs) {
  'use strict';

  // Study: Doe, Jane
  //    CT: CT SlicesCT2
  //   PET: PET NAC 2DPT2

  const ct130Base64 =
    '';
  const ct129Base64 =
    '';
  const pet180Base64 =
    '';
  const pet181Base64 =
    '';

  function pixelData2str (buf) {
    const bufView = new Uint16Array(buf);
    const len = bufView.length;
    let str = '';

    for (let i = 0; i < len; i++) {
      const word = bufView[i];
      const lower = word & 0xff;
      const upper = (word >> 8) & 0xff;

      str += String.fromCharCode(lower) + String.fromCharCode(upper);
    }

    return str;
  }

  function encodePixelData (pixelData) {
    const pixelDataAsString = pixelData2str(pixelData);
    const base64str = window.btoa(pixelDataAsString);

    return base64str;
  }

  function str2pixelData (str) {
    const buf = new ArrayBuffer(str.length * 2); // 2 bytes for each char
    const bufView = new Int16Array(buf);
    let index = 0;

    for (let i = 0, strLen = str.length; i < strLen; i += 2) {
      const lower = str.charCodeAt(i);
      const upper = str.charCodeAt(i + 1);

      bufView[index] = lower + (upper << 8);
      index++;
    }

    return bufView;
  }

  function getPixelData (base64PixelData) {
    const pixelDataAsString = window.atob(base64PixelData);
    const pixelData = str2pixelData(pixelDataAsString);

    return pixelData;
  }

  const ct1PixelData = getPixelData(ct130Base64);
  const ct2PixelData = getPixelData(ct129Base64);
  const pet1PixelData = getPixelData(pet180Base64);
  const pet2PixelData = getPixelData(pet181Base64);

  function getCTImage (imageId) {
    const width = 512;
    const height = 512;

    function getPixelData () {
      if (imageId == 'ct://1') {
        return ct1PixelData;
      } else if (imageId == 'ct://2') {
        return ct2PixelData;
      }

      throw 'unknown imageId';
    }

    const image = {
      imageId,
      minPixelValue: -3024,
      maxPixelValue: 2042,
      slope: 1.0,
      intercept: 0,
      windowCenter: 40,
      windowWidth: 400,
      getPixelData,
      rows: height,
      columns: width,
      height,
      width,
      color: false,
      columnPixelSpacing: 0.976562,
      rowPixelSpacing: 0.976562,
      sizeInBytes: width * height * 2
    };

    return {
      promise: new Promise((resolve) => {
        resolve(image);
      }),
      cancelFn: undefined
    };
  }

  function getPETImage (imageId) {
    const width = 128;
    const height = 128;

    function getPixelData () {
      if (imageId == 'pet://1') {
        return pet1PixelData;
      } else if (imageId == 'pet://2') {
        return pet2PixelData;
      }

      throw 'unknown imageId';
    }

    const image = {
      imageId,
      minPixelValue: 0,
      maxPixelValue: 32767,
      slope: 0.00108386,
      intercept: 0,
      windowCenter: 17.75742031,
      windowWidth: 35.51484062,
      getPixelData,
      rows: height,
      columns: width,
      height,
      width,
      color: false,
      columnPixelSpacing: 4.6875,
      rowPixelSpacing: 4.6875,
      sizeInBytes: width * height * 2
    };

    return {
      promise: new Promise((resolve) => {
        resolve(image);
      }),
      cancelFn: undefined
    };
  }

  // Register our imageLoader plugin with cornerstone
  cs.registerImageLoader('ct', getCTImage);
  cs.registerImageLoader('pet', getPETImage);
})(cornerstone);
